import React, { useState, useEffect } from 'react';
import {
    Box,
    Card,
    CardContent,
    Typography,
    Button,
    Table,
    TableHead,
    TableRow,
    TableCell,
    TableBody,
    TableContainer,
    Paper,
    Alert,
    CircularProgress,
    Chip,
    IconButton
} from '@mui/material';
import { Description, UploadFile, Delete } from '@mui/icons-material';

const DocumentsManagement: React.FC = () => {
    const [loading] = useState(false);
    const [error] = useState<string | null>(null);
    const [documents] = useState<
        Array<{
            id: number;
            name: string;
            type: string;
            accessLevel: string;
            uploadedAt: string;
        }>
    >([
        {
            id: 1,
            name: 'Documento Público',
            type: 'PDF',
            accessLevel: 'Livre',
            uploadedAt: new Date().toLocaleDateString('pt-BR')
        }
    ]);

    const handleUpload = () => {
        alert('Função de upload será integrada futuramente!');
    };

    const handleDelete = (docId: number) => {
        alert(`Excluir documento com ID: ${docId}`);
    };

    return (
        <Card>
            <CardContent>
                <Box display="flex" justifyContent="space-between" alignItems="center" mb={2}>
                    <Typography variant="h5">
                        Gerenciamento de Documentos
                    </Typography>
                    <Button variant="contained" startIcon={<UploadFile />} onClick={handleUpload}>
                        Enviar Documento
                    </Button>
                </Box>

                {error && (
                    <Alert severity="error" sx={{ mb: 2 }}>
                        {error}
                    </Alert>
                )}

                {loading ? (
                    <Box display="flex" justifyContent="center" alignItems="center" minHeight="150px">
                        <CircularProgress />
                    </Box>
                ) : (
                    <TableContainer component={Paper}>
                        <Table>
                            <TableHead>
                                <TableRow>
                                    <TableCell>Nome</TableCell>
                                    <TableCell>Tipo</TableCell>
                                    <TableCell>Nível de Acesso</TableCell>
                                    <TableCell>Data Upload</TableCell>
                                    <TableCell align="center">Ações</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {documents.map((doc) => (
                                    <TableRow key={doc.id}>
                                        <TableCell>{doc.name}</TableCell>
                                        <TableCell>{doc.type}</TableCell>
                                        <TableCell>
                                            <Chip label={doc.accessLevel} color="primary" size="small"/>
                                        </TableCell>
                                        <TableCell>{doc.uploadedAt}</TableCell>
                                        <TableCell align="center">
                                            <IconButton
                                                color="error"
                                                onClick={() => handleDelete(doc.id)}
                                                title="Excluir documento"
                                            >
                                                <Delete />
                                            </IconButton>
                                        </TableCell>
                                    </TableRow>
                                ))}
                            </TableBody>
                        </Table>
                    </TableContainer>
                )}
            </CardContent>
        </Card>
    );
};

export default DocumentsManagement;
